import React from 'react'
import { User } from '../interface/index'
import EditUserForm from '../forms/EditUserForm'

interface Props {
  user: User
  showAuth: boolean
}
export default function EditProfile({ user, showAuth }): JSX.Element {
  return (
    <EditUserForm initialValues={user} />
  )
}
